import React from "react";
import AndriodCell from "../AndriodCells/AndriodCells";

const Android = (props) => {
  return (
    <>
      {props.andriod.map((andriod, id) => (
        <AndriodCell key={id} andriod={andriod} />
      ))}
    </>
  );
};

export default Android;
